English | CBR | 24 Pages

Justice League v2 #23.3
Publisher:  DC Comics
Publication Date:  September 18, 2013

Writer:  China Mieville
Artists:  Mateus Santolouco, Carla Berrocal, Ricardo Burchielli, Liam Sharp, Jock, Tula Lotay, Marley Zarcone, Brendan McCarthy, Emma Rios, Emi Lenox, Jeff Lemire, Frazier Irving, David Lapham, Carmen Carnero, Sloane Leong, Kelsey Wroten, Michele Farran, Annie Wu, Zak Smith, Alberto Ponticelli, and Dan Green
Colorists:  Eva De La Cruz with Frazier Irving, Annie Wu, and Zak Smith
Letterer:  Taylor Esposito
Cover:  Brian Bollard

In a special coda to the fan-favorite DIAL H series, a lost E-Dial is discovered by four young criminals on the run in Littleville. But who is chasing them? And will they figure out how to control this nefarious dial before it's too late?

Thanks goes to Shining Knight for this release.

